#!/usr/bin/env python3

TIMEOUT=10

import time
import sys
import subprocess
import queue
import threading
import os
import os.path
import tempfile
import gzip
import io
import hashlib

Q = queue.Queue()


keeplooping=True
def threadFunc(so):
    while keeplooping:
        ln = ""
        while True:
            b = so.read(1)
            if len(b) == 0:
                return
            elif b == b"\n":
                break
            else:
                ln += b.decode(errors="replace")
        print(ln)
        Q.put(ln)
   
def read(fp,delim=None):
    s=b""
    while True:
        c = fp.read(1)
        if c == None:
            return s
        if (delim == None and c.isspace()) or c == delim:
            return s
        s += c
        if len(s) > 100:
            print("Line too long")
            assert 0
        
def readppm(fp):
    if type(fp) == bytes:
        fp = io.BytesIO(fp)
        
    sig = read(fp)
    if b"P6" != sig:
        print("sig=",sig)
    assert b"P6" == sig
    w = int(read(fp))
    h = int(read(fp))
    read(fp,b"\n")
    data = fp.read()
    return w,h,data
    
def findTestsuite():
    testsuites=[]
    for dirpath,dirs,files in os.walk(sys.path[0]):
        for fn in files:
            if fn.endswith(".c") or fn.endswith(".C"):
                with open(fn,"r") as fp:
                    data = fp.read()
                    data = data.replace("\r","")
                    H = hashlib.sha1()
                    H.update(data.encode())
                    s1 = H.hexdigest()
                    if s1 == "36bc2c3a255cf0cd3cff7bfa7b83187bd13b43d2":
                        testsuite = os.path.join(dirpath,fn)
                        testsuites.append(testsuite)
    return testsuites
                        
def main():
    
    testsuites=findTestsuite()
    if len(testsuites) == 0:
        print("Cannot find *unmodified* copy of the test suite.")
        return
        
    points=0

    summary=io.StringIO()
    
    try:
        print("Checking color output...",file=summary)
        if runTest(colorppm,summary):
            print("Correct color output from first test suite",file=summary)
            points = 120
        else:
            print("Checking non-color output...",file=summary)
            if runTest(nocolorppm,summary):
                print("Correct non-color output from first test suite",file=summary)
                points=100
            else:
                print("Wrong output from first test suite",file=summary)
                return
          
        print("First test suite OK",file=summary)
            
        
        for t in testsuites:
            print("Running second test suite...",file=summary)
            if tryAgain(t,summary):
                print("Second test suite OK",file=summary)
                print("All OK. Total points:",points,file=summary)
                return
        print("Wrong output from second test suite",file=summary)
    finally:
        print()
        print()
        print()
        print()
        print(summary.getvalue())
        print()
        print()
        
    
def tryAgain(ts,summary):
    with open(ts,"rb") as fp:
        odata = fp.read()
    try:
        print("Using",ts,"as testsuite...",file=summary)
        with open(ts,"wb") as fp:
            fp.write(gzip.decompress(testsuite2))
        if runTest(expected2,summary):
            return True
    finally:
        with open(ts,"wb") as fp:
            fp.write(odata)

def runTest(expectedZ, summary):
    
    now = int(time.time())
    
    scons = os.getenv("SCONS",os.path.abspath("scons.bat"))
    scons = "..\\scons\\scons.bat"
    
    P = subprocess.Popen( [scons],
        stdin=subprocess.PIPE,
        stdout=subprocess.PIPE,
        stderr=subprocess.STDOUT)
        
    si = P.stdin
    thr = threading.Thread(target=threadFunc, args=(P.stdout,))
    thr.start()

    start = time.time()
    
    while True:
        try:
            line = Q.get(block=True,timeout=TIMEOUT).strip()
        except queue.Empty:
            print("Timeout reached waiting for output!",file=sys.stderr)
            P.terminate()
            return
    
        now = time.time()
        if now - start > TIMEOUT:
            print("Timeout reached!",file=sys.stderr)
            return
            
        if "DONE" in line:
            tf = tempfile.NamedTemporaryFile(delete=False)
            try:
                tf.close()
                print("Using temporary file",tf.name)
                si.write(b"~c\n")
                si.write("screendump {}\n".format( tf.name ).encode() )
                si.write(b"quit\n")
                si.flush()
                P.wait(timeout=TIMEOUT)
                with open(tf.name,"rb") as fp:
                    aw,ah,actual = readppm(fp)
            finally:
                os.unlink(tf.name)
 

            unz = gzip.decompress(expectedZ)
            ew,eh,expected = readppm( unz )
                
            
            if ew != aw:
                print("Width mismatch; expected {}; got '{}'".format(ew,aw),file=summary)
                return
            if eh != ah:
                print("Height mismatch; expected {}; got '{}'".format(eh,ah),file=summary)
                return
            
            idx=0
            for y in range(ah):
                for x in range(aw):
                    for i in range(3):
                        a = actual[idx+i] & 0xf8
                        e = expected[idx+i] & 0xf8
                        if a != e:
                            print("Mismatch at pixel x={} y={}".format(x,y),file=summary)
                            print("Expected:",
                                "r=",expected[idx],
                                "g=",expected[idx+1],
                                "b=",expected[idx+2], file=summary)
                            print("Actual:",
                                "r=",actual[idx],
                                "g=",actual[idx+1],
                                "b=",actual[idx+2], file=summary)
                            return
                    idx+=3
              
            return True
    #endwhile
    
